INSERT INTO `assignments` VALUES (1,'2011-11-02 15:00:04','2011-11-02 15:00:04',1,1,NULL,1,NULL,'Test assignment for software tests'),(2,'2011-11-02 15:00:04','2011-11-02 15:00:04',3,2,NULL,1,NULL,'Test assignment for software tests 2'),(3,'2011-11-02 15:00:04','2011-11-02 15:00:04',2,1,NULL,2,NULL,'Test assignment for software tests 3'),(4,'2011-11-02 15:00:07','2011-11-02 15:00:07',1,4,NULL,4,1,'\n\n BCAL data base of constants used in MC\n\n Silicon PMT dark rate (from GlueX-doc-1754-v3)\n Single PE width to amplitude ratio\n 6.489/61.67 = 0.105 (from GlueX-doc-1754-v3)\n Pedestal width to single PE amplitude ratio\n 8.585/61.67 = 0.139 (from GlueX-doc-1754-v3)\n Variation of gains between individual SiPM tiles.\n Yi measured a value of ~4% and indicated this in\n private communication.\n This factor includes both the cross-talk and after-pulse\n probability for a 100ns window. The value from GlueX-doc-1754-v3\n was 15.7%, but is for a 1 us window. Private comminucation with\n Yi indicated a value of 12% from previous measurements with a\n 200 ns window. Note that the 100ns assumed in the current simulation\n has the actual pulse starting 25ns into that making the actual\n cross-talk/after-pulse window at 75ns. Estimatation from Yi for\n a 100ns window is ~10%, hence the value used here.\n integration widnows in [ns]\n Photon detection efficiency (from GlueX-doc-1754-v3)\n sampling fraction:\n The value of 12.5% from NIM A 596 (2008) 327â€“337 (a.k.a. GlueX-doc-1071)\n is superceded by Stamatis\' thesis value of ~9.5% due to the proper\n inclusion of the (inactive) cladding of the fiber\n Digitized values due to dark pulses only\n Inner region has 3 digitized values/event\n Outer region has 2 digitized values/event\nGX-doc 1069, Table 1 -- try to extract back to\nphotons per side per MeV in fiber\n4.6 / PDE / attentuation  (meaurements performed in center)\n75 = 4.6  / 0.12 / exp( -200 / 300 )\nset the sampling smearing coefficients:\n(from GlueX-doc 827 v3 Figure 13 )\ntime smearing comes from beam test time difference resolution with\nbeam incident on the center of the module\nno floor term, but leave the option here:\n Threshold applied to energy deposition in MeV (HDGeant)\n time window for two hit resolution in ns\n maximum number of hits per readout channels'),(5,'2011-11-02 15:00:08','2011-11-02 15:00:08',1,4,NULL,5,1,'\n\n Parameters used for deciding whether 2 BCAL clusters\n should be merged or not when creating DBCALPhoton\n objects out of DBCALShower objects\n\n Minimum separation between 2 clusters for them NOT to be merged'),(6,'2011-11-02 15:00:08','2011-11-02 15:00:08',1,4,NULL,6,1,'\n\n CDC data base of constants used\n\n The error on the drift time in the CDC. The drift times\n for the actual CDC hits coming from the input file\n are smeared by a gaussian with this sigma. 150.0/55.0*1E-9 seconds\n The time window for which CDC hits are accumulated.\n This is used to determine the number of background\n hits in the CDC for a given event. in nanoseconds\n The error in the energy deposition measurement in the\n CDC due to pedestal noise\n CDC drit speed unit?\n thime window for two hit resolution in ns\n number of hit per radout channel\n threshold applied in KeV\n straw radius in cm'),(7,'2011-11-02 15:00:09','2011-11-02 15:00:09',1,4,NULL,7,1,'\n\n Parameters used for deciding whether 2 FCAL clusters\n should be merged or not when creating DFCALPhoton\n objects out of DFCALCluster objects\n\n Minimum separation between 2 clusters for them NOT to be merged'),(8,'2011-11-02 15:00:09','2011-11-02 15:00:09',1,4,NULL,8,1,'\n\n FCAL data base of constants used in MC\n\n Photon-statistics factor for smearing hit energy (from Crisss MC)\n (copied from DFCALMCResponse_factory.cc 7/2/2009 DL)\n Single block energy threshold (applied after smearing)\n 20 MeV, units are in GeV\n Outer Glass. Attenuation length in cm.\n Inner Glass. Attenuation length in cm.\n Radius of inner lead glas blocks in cm\n Radius of inner glass\n effective speed of light in glass in cm/ns\n block width in cm\n block length in cm\n time windown for two hit separation in ns\n maximum number of hits in a single block\n threshold applied in a block (in hdgeant)\n Note: different unit than for smeared-blocks threshold (see above)\n radius of the calorimeter\n number of blocks in central row\n number of blocks in central column'),(9,'2011-11-02 15:00:10','2011-11-02 15:00:10',1,4,NULL,9,1,'\n% h0 m0 s0 h1 m1 s1 h2 m2 s2'),(10,'2011-11-02 15:00:10','2011-11-02 15:00:10',1,4,NULL,10,1,NULL),(11,'2011-11-02 15:00:10','2011-11-02 15:00:10',1,4,NULL,11,1,NULL),(12,'2011-11-02 15:00:11','2011-11-02 15:00:11',1,4,NULL,12,1,'\n electron drift velocity\n dead wire radius\n other dead wire radius\n threshold in keV\n threshold in fC\n electron charge in fC\n diffiusion speed cm^2/s --&gt; 200 microns at 1 cm\n The error on the drift time in the FDC. The drift times\n for the actual FDC hits coming from the input file\n are smeared by a gaussian with this sigma.\n 200.0/55.0*1.0E-9;	# in seconds\n The error in the distance along the wire as measured by\n the cathodes. This should NOT include the Lorentz\n effect which is already included in hdgeant. It\n should include any fluctuations due to ion trail density\n etc. 150.0 microns  [microns]\nFDC_CATHODE_SIGMA 50.0\n The FDC pedestal noise is used to smear the cathode ADC\n values such that the position along the wire has the resolution\n specified by FDC_CATHODE_SIGMA.\n units in pC (calculated from FDC_CATHODE_SIGMA in SmearFDC)\nFDC_PED_NOISE 1.527\n Time window for acceptance of FDC hits units in nanoseconds\n Fraction of FDC hits to randomly drop (0=drop nothing 1=drop everything)'),(13,'2011-11-02 15:00:11','2011-11-02 15:00:11',1,4,NULL,13,1,'\n% x z      bx bz     nx        nz'),(14,'2011-11-02 15:00:12','2011-11-02 15:00:12',1,4,NULL,14,1,'\n% x z      bx bz     nx        nz'),(15,'2011-11-02 15:00:12','2011-11-02 15:00:12',1,4,NULL,15,1,'\n% qru qrv'),(16,'2011-11-02 15:01:38','2011-11-02 15:01:38',1,4,NULL,16,1,'\n\n This file generated from the file &quot;OUTSF7.TXT&quot; via the script poisson2calibDB.pl\n Lines begining with &quot;#--&quot; below are comments copied from the original file.\n\n-- Los Alamos National Laboratory Poisson Superfish\n-- Program SF7 written by James H. Billen and Lloyd M. Young\n--\n-- The original Poisson Superfish codes were developed\n-- by Ron F. Holsinger in collaboration with Klaus Halbach.\n-- These programs are provided as a service to the accelerator\n-- community by the Los Alamos Accelerator Code Group (LAACG).\n--\n-- (c) Copyright 1985-2005, by the Regents of the University of California.\n-- This software was produced under U. S. Government contract W-7405-ENG-36\n-- by Los Alamos National Laboratory, which is operated by the University\n-- of California for the U. S. Department of Energy.  Neither the Government\n-- nor the University makes any warranty, express or implied, or assumes\n-- any liability or responsibility for its use, or represents that use of\n-- this software would not infringe privately owned rights.\n-- Unpublished - rights reserved under Copyright Laws of the United States.\n--\n--\n-- Program SF7  7.17  released 1-13-2006\n--\n-- Program file: C:LANLSF7.EXE\n-- SF.INI file: C:LANLSF.INI  8-13-2009   6:09:50\n-- Solution file C:WINDOWSDESKTOPBFIELD_POISSONGLUEX_SOL_04.T35.\n-- Memory used for GLUEX_SOL_04.T35 arrays:      11.922 M\n-- Reading keyword commands and data from file:\n-- GLUEX_SOL_04.IN7\n--\n-- Magnetic fields for a rectangular area with corners at:\n-- (Rmin,Zmin) = (0.0,-100)\n-- (Rmax,Zmax) = (250,600)\n-- R and Z increments:   250   700\n--\n--       R             Z              Br            Bz            |B|           A           dBz/dr        dBr/dz        Field\n--     (cm)          (cm)             (G)           (G)           (G)         (G-cm)        (G/cm)        (G/cm)        Index\n\n NOTE: The values from the original file were changed from cm/Gauss to\n       inches/Tesla below (despite any comments above).\n\n     x            y            z            Bx          By           Bz'),(17,'2011-11-02 15:03:05','2011-11-02 15:03:05',1,4,NULL,17,1,'\n\n This file generated from the file &quot;OUTSF7.TXT&quot; via the script poisson2calibDB.pl\n Lines begining with &quot;#--&quot; below are comments copied from the original file.\n\n-- Los Alamos National Laboratory Poisson Superfish\n-- Program SF7 written by James H. Billen and Lloyd M. Young\n--\n-- The original Poisson Superfish codes were developed\n-- by Ron F. Holsinger in collaboration with Klaus Halbach.\n-- These programs are provided as a service to the accelerator\n-- community by the Los Alamos Accelerator Code Group (LAACG).\n--\n-- (c) Copyright 1985-2005, by the Regents of the University of California.\n-- This software was produced under U. S. Government contract W-7405-ENG-36\n-- by Los Alamos National Laboratory, which is operated by the University\n-- of California for the U. S. Department of Energy.  Neither the Government\n-- nor the University makes any warranty, express or implied, or assumes\n-- any liability or responsibility for its use, or represents that use of\n-- this software would not infringe privately owned rights.\n-- Unpublished - rights reserved under Copyright Laws of the United States.\n--\n--\n-- Program SF7  7.17  released 1-13-2006\n--\n-- Program file: C:LANLSF7.EXE\n-- SF.INI file: C:LANLSF.INI  8-13-2009   6:09:50\n-- Solution file C:WINDOWSDESKTOPBFIELD_POISSONGLUEX_SOL_04.T35.\n-- Memory used for GLUEX_SOL_04.T35 arrays:      11.922 M\n-- Reading keyword commands and data from file:\n-- GLUEX_SOL_04.IN7\n--\n-- Magnetic fields for a rectangular area with corners at:\n-- (Rmin,Zmin) = (0.0,-100)\n-- (Rmax,Zmax) = (250,600)\n-- R and Z increments:   250   700\n--\n--       R             Z              Br            Bz            |B|           A           dBz/dr        dBr/dz        Field\n--     (cm)          (cm)             (G)           (G)           (G)         (G-cm)        (G/cm)        (G/cm)        Index\n\n NOTE: The values from the original file were changed from cm/Gauss to\n       inches/Tesla below (despite any comments above).\n\n     x            y            z            Bx          By           Bz'),(18,'2011-11-02 15:03:10','2011-11-02 15:03:10',1,4,NULL,18,1,'\n\n This file contains the &quot;original&quot; field map produced by Paul Brindza. The\n original file name was &quot;dsolenoid.table&quot; and it was used up until July 2007\n as the default map. It was discoverd sometime in 2005 or 2006 that this map\n was probably done assuming a smaller current than what we assume is the nominal.\n I have a vague recollection that Paul told me it was probably calculated\n at 1400A instead of 1500A. This would seem consistent with the a comparison of\n this map to a more recently produced one that used 1500A.\n\n 7/19/2007  D. Lawrence\n---------------------------------------------------------------------------\n\n\n=head1 LASS solenoid field map\n\n=head2 Instructions\n\n This file is a self-extracting script.  It will produce a field map\n for use in the HDGeant simulation simply by typing the following:\n\n	perl dsolenoid.table &gt;solenoid.map\n\n From: P. Brindza\n Date: September 21, 2001\n\n   This file contains a field map of the LASS solenoid.  It was generated\n   by P. Brindza from his 2D model of the magnet.  Here are Paul\'s notes.\n\n [P Brindza, September 21, 2001]\n\n The solenoid model has all 17 superconducting coils and all the yoke\n modifications that I have proposed and that have been agreed to by the D\n team as per the last collaboration meeting.  The yoke also has the large\n hole on the upstream end that we discussed at the last meeting.\n\n As an aside it would be useful to try to compare the performance of the\n magnet with and without the large upstream hole in the yoke.  If this is\n something that you can do I can easily send you a grid from the other model.\n\n I have added a 4 inch thick iron wall at Z = 280.75  inches to simulate\n the magnetic effect of the iron phototube frame for the lead glass\n detector.\n\n The physical end of the iron yoke is at 200.75 inches.\n\n The grid is on a one inch spacing because my model was done in inches.\n This is because the drawings are in inches and my dog ate the homework\n where I converted them all to metric!\n\n If a finer grid is desired please let me know.\n\n The text file has 6 entries for each point , X , Y , Z , Bx , By , Bz\n The range is from  0&lt;X&lt;40 inches , 30 &lt;Z&lt; 280 inches  , Y=0\n\n The inside diameter of the cryostats is 40 inches so you may wish to\n truncate the grid.\n\n The XZ plane (Y=0) is a symmetry plane with a tangential fields boundary\n condition in the TOSCA model so By = 0.0000 in that plane.\n\n The X component is thus the same as an R component.\n\n The upstream outside face of the solenoid yoke iron is at Z=6 inches.\n This should allow you to locate the target location.\n\n\n [R. Jones, September 21, 2001]\n\n Following the HDFast conventio the master coordinate system origin in\n HDGeant is on the z-axis in the plane of the downstream surface of the\n mirror plate where it joins the iron yoke of the first coil.  From the\n drawings I estimate that the distance from that plane to the origin in\n Paul\'s model is about 26 inches, or 66 cm.\n\n =======================================================================\n          100         100           1\n  1 X\n  2 Y\n  3 Z\n  4 BX\n  5 BY\n  6 BZ\n  0 [INCH]\n     x            y            z            Bx          By           Bz'),(19,'2011-11-02 15:03:24','2011-11-02 15:03:24',1,4,NULL,19,1,'\n\n This map is from the file originally named &quot;smoothsolenoid1500.table&quot;. It was\n produced by Paul B. with a the step size adjusted (I think just made constant)\n so that the &quot;kink&quot; in the field at the upstream end would be smoothed out.\n\n This was generated assuming a current of 1500A and it also extends the\n field further outside the bore of the magnet than the original map.\n\n The units here are inches and Tesla. The origin of the coordinate system\n is on the beamline and displaced by 66cm from the origin used in hdgeant.\n See the comments at the top of solenoid_1400 for more details.\n\n 7/19/2007  D. Lawrence\n---------------------------------------------------------------------------\n\n\n\n         100         100           1\n 1 X\n 2 Y\n 3 Z\n 4 BX\n 5 BY\n 6 BZ\n 0 [INCH]\n\n     x            y            z            Bx          By           Bz'),(20,'2011-11-02 15:03:39','2011-11-02 15:03:39',1,4,NULL,20,1,'\n\n This map is from the file originally named &quot;largegridat1500.table&quot;. It was\n produced by Paul B. but had a &quot;kink&quot; in the field at the upstream end\n of the magnet. This was due to different step sizes being used in the\n upstream area than in the bore since it saved time in the calculation\n and it was thought the field in that region wasn\'t as important. This\n was later fixed and the &quot;smoothed&quot; map is now in solenoid_1500.\n\n This was generated assuming a current of 1500A and it also extends the\n field further outside the bore of the magnet from the original.\n NOTE: Another map exists that was originally named &quot;biggridat1500.table&quot;\n that extends the field even further in radius (out to 100 inches as\n opposed to the 80 inches in this map). That was converted to this format\n since it did not have the By component written out and so would have\n needed to be converted to include By in order to satisfy the format\n that the rest of these map files are in.\n\n The units here are inches and Tesla. The origin of the coordinate system\n is on the beamline and displaced by 66cm from the origin used in hdgeant.\n See the comments at the top of solenoid_1400 for more details.\n\n 7/19/2007  D. Lawrence\n---------------------------------------------------------------------------\n\n\n\n         100         100           1\n 1 X\n 2 Y\n 3 Z\n 4 BX\n 5 BY\n 6 BZ\n 0 [INCH]\n\n     x            y            z            Bx          By           Bz'),(21,'2011-11-02 15:03:59','2011-11-02 15:03:59',1,4,NULL,21,1,'\n\n This map is from the file originally named &quot;solenoid2007.table&quot;. It was\n produced by Paul B. at Elke\'s request with some deliberate imperfections.\n Only they know the nature of the imperfections at this time. The idea is\n that we can use use this to study the effect a lack of knowledge of the\n field will have on reconstruction.\n\n This was generated assuming a current of 1500A.\n\n The units here are inches and Tesla. The origin of the coordinate system\n is on the beamline and displaced by 66cm from the origin used in hdgeant.\n See the comments at the top of solenoid_1400 for more details.\n\n 7/19/2007  D. Lawrence\n---------------------------------------------------------------------------\n\n\n\n        101           1           1\n 1 X\n 2 Y\n 3 Z\n 4 BX\n 5 BY\n 6 BZ\n 0 [INCH]\n\n     x            y            z            Bx          By           Bz'),(22,'2011-11-02 15:04:14','2011-11-02 15:04:14',1,4,NULL,22,1,'\n#\n# CFX-Post Generic Export\n#\n# CFX-11.0 build 2007.08.22-22.05\n#\n# Generated on:  2009/05/11 08:39:14\n#\n# Generated from file: G:/fmartin/200903/20090312-2 Simulation Files/Magnetostatic/file.rst\n#\n\n[Name]\nPlane 1\n\n[Data]\nX [ in ]	 Y [ in ]	 Z [ in ]	 Magnetic Flux X	 Magnetic Flux Y	 Magnetic Flux Z'),(23,'2011-11-02 15:05:45','2011-11-02 15:05:45',1,4,NULL,23,1,'\n\n This file generated from the file &quot;OUTSF7.TXT&quot; via the script poisson2calibDB.pl\n Lines begining with &quot;#--&quot; below are comments copied from the original file.\n\n-- Los Alamos National Laboratory Poisson Superfish\n-- Program SF7 written by James H. Billen and Lloyd M. Young\n--\n-- The original Poisson Superfish codes were developed\n-- by Ron F